import { logout } from "../redux/apiCall";
import { useNavigate } from "react-router-dom";
import { useDispatch } from "react-redux";




export const handleLogout = () => {

    dispatch(logout());
    navigate("/");
  };

export const handleProfile = () => {
    const navigate = useNavigate();
    navigate("/user");
}
